import React, { useState, useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";import { getAllPizzas } from "../actions/pizzaActions";
import Pizza from "../components/Pizza";
import pizzas from "../screens/Pizzasdata";
export default function Homescreen() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getAllPizzas());
  }, []);

  return (
    <div>
      <div className="row">
        {pizzas.map((pizza) => {
          return (
            <div className="col-md-4 p-3">
              <div>
                <Pizza pizza={pizza} />
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}
